import React, { useState, useEffect } from "react";
import { useParams, Link, useNavigate } from "react-router-dom";
import "./adduser.css";
import axios from "axios";
import { toast, Toast } from "react-toastify";

const initialState = {
  FirstName,
  LastName: "",
  Location: "",
  Email: "",
  DOB: "",
  Education: "",
};

const Adduser = () => {
  const [state, Setstate] = useState(initialState);
  const { FirstName, LastName, Location, Email, DOB, Education } = state;
  const navigate = useNavigate();
  const handleSubmit = (e) => {
    e.preventDefault();
    if (!FirstName || !LastName || !Location || !Email || !DOB || !Education) {
      toast.error("please provide value into each input field");
    } else {
      axios
        .post("http://localhost:5000/api/post", {
          FirstName,
          LastName,
          Location,
          Email,
          DOB,
          Education,
        })
        .then(() => {
          Setstate({
            FirstName,
            LastName,
            Location,
            Email,
            DOB,
            Education,
          });
        })
        .catch((err) => toast.error(err.res.data));
        toast.success("User Added Successfully")
      setTimeout(() => navigate("/"), 500);
    }
  };
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    Setstate({
      ...state,
      [name]: value,
    });
  };
  return (
    <div className="container">
      <h2>Add Student Details</h2>
      <form onSubmit={handleSubmit}>
        <div className="Container">
          <label htmlFor="fname">FirstName :</label>
          <input
            id="fname"
            name="fname"
            type="text"
            value={FirstName}
            placeholder="Enter your first name"
            onChange={handleInputChange}
          />
        </div>
        <div>
          <label> LastName</label>
          <input
            id="lname"
            name="lname"
            type="text"
            value={LastName}
            placeholder="Enter your last name"
            onChange={handleInputChange}
          />
        </div>
        <div>
          <label>Location</label>
          <input id="location" type="text" value={Location} placeholder="Enter your location"  onChange={handleInputChange} />
        </div>
        <div>
          <label>Email</label>
          <input id= "email" type="email" value={Email} placeholder="Enter your email" onChange={handleInputChange} />
        </div>
        <div>
          <label>DOB</label>
          <input id="date" type="date" placeholder="dd/mm/yyyy" value={DOB} onChange={handleInputChange} />
        </div>
        <div>
          <label>Education</label>
          <input id="educate" type="text" value={Education} placeholder="Enter your education" onChange={handleInputChange} />
        </div>
        <input type="submit" value="save" />
        <Link to="/">
          <input type="button" value="goback" />
        </Link>
      </form>
    </div>
  );
};

export default Adduser;

